void VR16EnergyParams::init_parameters()
{

    mTmeasure = 37.0 + K0;  /* temperature of param measurements */
    mlxc37 = 107.856;       /* parameter for logarithmic loop energy extrapolation            */

    init_stack37();
    init_enthalpies();

    init_hairpin37();
    init_bulge37();
    init_internal_loop37();

    init_mismatch_i37();
    init_mismatch_h37();
    init_mismatch_m37();
    init_mism_h();

    init_dangle5_37();
    init_dangle3_37();
    init_dangle3_h();
    init_dangle5_h();

    /* constants for linearly destabilizing contributions for multi-loops
       F = ML_closing + ML_intern*k + ML_BASE*u  */
    /* old versions erroneously used ML_intern*(k-1) */
    mMLBase37 = 0;
    mMLClosing37 = 340;
    mMLIntern37 =  40;

    /* Ninio-correction for asymmetric internal loops with branches n1 and n2 */
    /*    ninio_energy = min{max_ninio, |n1-n2|*F_ninio[min{4.0, n1, n2}] } */

    /* only F[2] used */
    mFNinio37[0] = 0;
    mFNinio37[1] = 40;
    mFNinio37[2] = 50;
    mFNinio37[3] = 20;
    mFNinio37[4] = 10;

    /* penalty for AU (or GU) terminating helix) */
    /* mismatches already contain these */
    mTerminalAU = 50;

    /* penalty for forming a bi-molecular duplex */
    mDuplexInit = 410;

    /* stabilizing contribution due to special hairpins of size 4 (tetraloops) */
    init_tetraloops();
    init_tetra_energy37();

    mTetraEnth37 = -400;
    init_triloop_e37();

    init_int11_37();
    init_int11_h();

    init_int21_37();
    init_int21_h();

    init_int22_37();
    init_int22_h();

}

